oiing vooraf en zonder toevoeging van vetstof: - ln de voolvenvarmde oven op 2100C: 12 tot 15 minuten. - ln de bakpan, op een gemiddeld vuur: 10 tot 12 minuten. Halverwege de baktijd omdraaien. Fabriqué par / Gefabriceerd door: Cité Marine Cl du Porzo - 56700 Kervignac - France / Frankrijk', 'https://static.openfoodfacts.org/images/products/325/039/186/6212/front_fr.9.400.jpg', '7.1', '0.7', '10.5', '0.9', '', '12.4', '0.75', '0.295275590551181', '', '1');

